import React from 'react';

class Badge extends React.Component {
    render() {
        return (<div>
            <div>
                <img src='' alt='header'></img>
            </div>
            <div>
                <h1>Daniela<br></br>Morales</h1>
            </div>
            <div>
                <p>Developer Full Stack and Data Scientist</p>
            </div>

        </div>);
    }
}

export default Badge;
